for key, value in pairs(MultiBot.data.itemus) do
	local tLevel = nil
	
	if(value[2] < 11) then tLevel = "L10"
	elseif(value[2] < 21) then tLevel = "L20"
	elseif(value[2] < 31) then tLevel = "L30"
	elseif(value[2] < 41) then tLevel = "L40"
	elseif(value[2] < 51) then tLevel = "L50"
	elseif(value[2] < 61) then tLevel = "L60"
	elseif(value[2] < 71) then tLevel = "L70"
	else tLevel = "L80"
	end
	
	local tRare = "R" .. MultiBot.IF(value[3] < 10, "0", "") .. value[3]
	local tSlot = "S" .. MultiBot.IF(value[5] < 10, "0", "") .. value[5]
	
	if(MultiBot.itemus.index[tLevel] == nil) then MultiBot.itemus.index[tLevel] = {} end
	if(MultiBot.itemus.index[tLevel][tRare] == nil) then MultiBot.itemus.index[tLevel][tRare] = {} end
	if(MultiBot.itemus.index[tLevel][tRare][tSlot] == nil) then MultiBot.itemus.index[tLevel][tRare][tSlot] = {} end
	table.insert(MultiBot.itemus.index[tLevel][tRare][tSlot], value[1])
end

MultiBot.itemus.addItems = function()
	local tItems = MultiBot.itemus.frames["Items"]
	local tTable = MultiBot.itemus.index[MultiBot.itemus.level]
	if(tTable ~= nil) then tTable = tTable[MultiBot.itemus.rare] end
	if(tTable ~= nil) then tTable = tTable[MultiBot.itemus.slot] end
	
	for key, value in pairs(tItems.buttons) do value:Hide() end
	table.wipe(tItems.buttons)
	
	if(tTable == nil) then return SendChatMessage("There are no Items for this Combination.", "SAY") end
	local tTo = table.getn(tTable)
	local tIndex = 0
	
	local tColor = "cff"
	if(MultiBot.itemus.rare == "R00") then tColor = tColor .. "9d9d9d" end -- Poor: Grey
	if(MultiBot.itemus.rare == "R01") then tColor = tColor .. "ffffff" end -- Common: White
	if(MultiBot.itemus.rare == "R02") then tColor = tColor .. "1eff00" end -- Uncommon: Green
	if(MultiBot.itemus.rare == "R03") then tColor = tColor .. "0070dd" end -- Rare: Blue
	if(MultiBot.itemus.rare == "R04") then tColor = tColor .. "a335ee" end -- Epic: Purple
	if(MultiBot.itemus.rare == "R05") then tColor = tColor .. "ff8000" end -- Legendary: Orange
	if(MultiBot.itemus.rare == "R06") then tColor = tColor .. "ff0000" end -- Artifact: Red
	if(MultiBot.itemus.rare == "R07") then tColor = tColor .. "e6cc80" end -- Heirlooms: Gold
	
	SendChatMessage(tTo, "SAY")
	
	if(tTo > 112) then tTo = 112 end
	
	for i = 1, tTo do
		local tIcon = GetItemIcon(tTable[i])
		local tName, tLink = GetItemInfo(tTable[i])
		
		local tX = (tIndex%8) * 38
		local tY = math.floor(tIndex/8) * -37.25
		
		if(MultiBot.itemus.every and tLink == nil) then tLink = tTable[i] end
		
		if(tLink ~= nil) then
			local tButton = tItems.addButton(tTable[i], tX, tY, tIcon, tLink)
			tButton.id = tTable[i]
			
			tButton.doLeft = function(pButton)
				MultiBot.doDotWithTarget(".additem", pButton.id .. " 1")
			end
			
			tIndex = tIndex + 1
		end
	end
end